import { useState } from 'react';

import {
  Form,
  Input,
  Button,
  Radio,
  Select,
  Cascader,
  DatePicker,
  InputNumber,
  TreeSelect,
  Switch,
} from 'antd';

const LoginForm = () => {
  const [componentSize, setComponentSize] = useState('default');

  const onFormLayoutChange = ({ size }) => {
    setComponentSize(size);
  };

  return (
    <>
      <Form
        labelCol={{
          span: 4,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        initialValues={{
          size: componentSize,
        }}
        onValuesChange={onFormLayoutChange}
        size={componentSize}
      > 
        <div>
          <Input name="user-id" label="아이디"/>
        </div>
        <Form.Item label="Input">
        </Form.Item>

        <Form.Item label="Input">
          <Input name="user-name"/>
        </Form.Item>

        <Form.Item label="Select">
          <Select>
            <Select.Option value="demo">Demo</Select.Option>
          </Select>
        </Form.Item>
        <Form.Item label="TreeSelect">
          <TreeSelect
            treeData={[
              {
                title: 'treeDataTest',
                value: 'treeDataTest',
                children: [
                  {
                    title: 'treeDataChiledren1',
                    value: 'treeDataChiledren1',
                  },
                  {
                    title: 'treeDataChiledren2',
                    value: 'treeDataChiledren2',
                  },
                  {
                    title: 'treeDataChiledren3',
                    value: 'treeDataChiledren3',
                  }
                ],
              },
            ]}
          />
        </Form.Item>
        <Form.Item label="Cascader">
          <Cascader
            options={[
              {
                value: 'zhejiang',
                label: 'Zhejiang',
                children: [
                  {
                    value: 'hangzhou',
                    label: 'Hangzhou',
                  },
                ],
              },
            ]}
          />
        </Form.Item>
        <Form.Item label="DatePicker">
          <DatePicker />
        </Form.Item>
        <Form.Item label="Button">
          <Button>Button</Button>
        </Form.Item>
      </Form>
    </>
  );
};


export default LoginForm;
